import React from 'react';
import Button from 'react-bootstrap/Button'

function BoostBox() {
    return (
        <div id="boost-box">
            <h2 id="boost-title">Boost your links today</h2>
            <Button id="boost-btn" className="intro-btn" size="lg" >Get Started</Button>
        </div>
    )
}
export default BoostBox;
